// 1. Ambil data secara eksplisit dari node Master dan Scan
const masterData = $("EXTRACT_FILE_MASTER").all(); 
const scanItems = $("EXTRACT_FILE_SCAN").all(); 

// 2. Ambil tanggal dari trigger (jika ada) atau pakai tanggal hari ini
// Ini untuk membuat kolom "Audit_YYYY-MM-DD" secara otomatis
const auditDate = $("INPUT_TRIGGER").first().json.body?.tanggal_audit || new Date().toISOString().split('T')[0];
const dateHeader = `Audit_${auditDate}`;

// 3. Kumpulkan semua ID dari hasil scan ke dalam Set (Deduplikasi)
// Kita pakai Set agar pencarian ID nanti sangat cepat (O(1))
const scannedSet = new Set();
scanItems.forEach(item => {
    // Ambil kolom pertama (antisipasi nama kolom CSV yang beda-beda)
    let val = Object.values(item.json)[0]; 
    if (val) {
        // Bersihkan data dari null characters (ciri khas RFID) dan spasi
        const cleanID = val.toString().replace(/\0/g, '').trim().toUpperCase();
        scannedSet.add(cleanID);
    }
});

// 4. Bandingkan data Master dengan daftar Scanned ID
return masterData.map(asset => {
    // Ambil Asset_ID dari Master (sesuaikan dengan nama kolom di Excel kamu)
    const assetID = (asset.json.Asset_ID || "").toString().replace(/\0/g, '').trim().toUpperCase();

    // Cek apakah ada di dalam daftar yang terscan
    const isFound = scannedSet.has(assetID);

    return {
        json: {
            ...asset.json,
            [dateHeader]: isFound ? "FOUND" : "MISSING"
        }
    };
});

const binaryData = $input.item.binary;
const result = [];

// Loop semua file yang masuk ke webhook
for (const key in binaryData) {
  const file = binaryData[key];

  result.push({
    json: { 
      fileKey: key, 
      fileName: file.fileName,
      // Mengambil ekstensi (xlsx/csv) sebagai identitas utama
      fileExtension: file.fileExtension.toLowerCase() 
    },
    binary: { 
      // Kita bungkus ulang dengan nama 'data' agar node selanjutnya mudah membacanya
      data: file 
    }
  });
}

return result;
